import React from "react";

const Search = () => {
  return (
    <form onSubmit={(e) => handleSubmit(e)} className="search">
      <i className="fas fa-2x fa-align-justify"></i>
      <input
        onChange={(e) => setInput(e.target.value)}
        value={input}
        type="text"
        placeholder="Search..."
      />
      <SearchResult />
    </form>
  );
};

export default Search;
